import React from "react";
import studio from "../images/1x1.png";
import twoBedroom from "../images/2x2.png";
import threeBedroom from "../images/3x3.png";
import fourBedroom from "../images/4x4.png";



const FloorPlans = () => {

    return (
        <div>
            <h1>Floor plans</h1>
            <img src={studio} />
            <img src={twoBedroom} />
            <img src={threeBedroom} />
            <img src={"../images/4x4.png"} />
            <div>
                <iframe width="100%" height="100%" title="Google 360 Tour iframe" name="Google 360 Tour" frameBorder="0"
                        src="https://my.matterport.com/show/?m=RDxufgcDTJp&amp;play=1"></iframe>
            </div>
        </div>
    );

}

export default FloorPlans;
